import { Fragment, FunctionComponent } from "react";
import { NavBar } from "../component/NavBar";

export interface ICheckoutProps{};

const levelData = [{name:"Associate",value:"5%",id:"associate"},{name:"Diamond", value:"30%", id:"diamond"}];

export const Checkout: FunctionComponent<ICheckoutProps> = (props) => {
return(
  <Fragment>
     <NavBar />
    <div>
      <h1>This is the checkout page</h1>
      <div className="flex_row">
        {levelData.map((level, index: number) =>{
          return(
            <input type="radio" name={level.name} value={level.value} id={level.id}/>
          )
        })}
      </div>

    </div>
  </Fragment>
)
}
